INSERT INTO `posts` VALUES ('009c1801-a87e-4e58-b1fb-644b836e396c','Akuma no Hanayome  ','IKEDA Etsuko','','(Ch.2 & Ch.3) In Chapter 2 Deimos possesses the dead body of a classmates mother to torture her and In chapter 3 he possesses the Mc\'s body to let another classmate know that she knows she\'s a werewolf.','Akita Shoten','Possession()','1611591482732_1.jpg','1611591482810_3.jpg',1,'2021-01-25 16:18:02','Manga',NULL,'1975',1),('00c0a1e4-37e2-4904-bd71-84499cebd710','Immortal Regis','GA On-Bi','','(Ch.20) The Mcs sword has a mind of its own and wants to seduce him taking the shape of the girl he likes. ','Daiwon','Transformation()','1611269090839_14.jpg','1611269090840_15.jpg',1,'2021-01-21 22:44:50','Manga',NULL,'2006',1),('00f37a20-7e2f-48cc-ad2f-27df8473846d','Mantra','Mike W. Barr','','(Issue 1) For 1500 years each time he dies, an archmage puts his soul in another body. When the mage is captured and he\'s killed, he ends up in a woman\'s body.','Malibu','Possession()','1612736542950_3.JPG','1612736544073_4.JPG',1,'2021-02-07 22:22:24','Western',NULL,'1993',1),('01263541-1489-4211-ad05-68f9358f26c8','Change!','Miyamoto Tatsuya','','Our female mc is easily possessed accidentally throughout the volumes.','N/A','Possession()','1610958467043_001_a_1.png','1610958467664_004_a_4.png',1,'2021-01-18 08:27:48','Manga',NULL,'Unknown',1),('0172b8ff-204e-4fec-adcb-cb8390108686','Futoku No Guild','KAWAZOE Taichi','','While going through a foret of ghosts one of the female leads gets possessed. (Ch.28) (NSFW)','Square Enix','Possession()','1610496744884_12.jpg','1610496744885_11.jpg',1,'2021-01-13 00:12:25','Manga',NULL,'2017',1),('022131d5-5bf3-4848-a76a-fc8f40bd65ef','Taimashin - Masatsu Note  ','Taimashin - Masatsu Note  ','','(Vol.1) The Mc in the opening scenes kills a woman being assaulted by a thug. Turns out she was a demon. ','Gentosha (2007)\r\nScholar (1995)\r\nSony Magazines (1997)','Possession()','1614214949546_Vol1.JPG','1614214949613_vol1a.JPG',1,'2021-02-2